import React, { Component } from "react";
import SigningComponent from "../components/auth/SigningComponent";
import Layout from "../components/Layout/Layout";

class SignIn extends Component {
  render() {
    return (
      <Layout>
        <SigningComponent />
      </Layout>
    );
  }
}
export default SignIn;
